pragma solidity ^0.5.0;

contract SimpleStorage {

    //structure of document
    struct Document {
        uint idDoc;
        bytes32 name;
        bytes32 hash;
    }

    struct User {
        uint id;
        bytes32 name;
        Document[] userDocuments;
    }

    struct NUser{
        uint id;
        bytes32 name;
        bytes32 [] idDoc;
        bytes32 [] nameDoc;
        bytes32 [] hashDoc;
    }

    Document[] public allDocuments;
    User[] public allUsers;

    //registered users
    uint[] users = [15447, 15448, 15449];

    Document public soyPdf1 = Document(111, "soyPdf1", "A1111");
    Document public soyPdf2 = Document(222, "soyPdf2", "A2222");

    function addDocuments() public returns (uint, bytes32, bytes32) {
        Document memory tempDoc = Document({
            idDoc: 123,
            name: "QmYJhQipMiizfRCbYDsdCP4",
            hash: "QMF5vnRjc7yiYEjSPimZ1fy"
            });
        allDocuments.push(tempDoc);
        return (tempDoc.idDoc, tempDoc.name, tempDoc.hash);
    }

    function buildUser() public returns (uint, bytes32, uint[] memory, bytes32[] memory, bytes32[] memory){
        addDocuments();
        addDocuments();
        addDocuments();
        User memory tempUser  = User({
            id: 756,
            name: "Sergio",
            userDocuments: allDocuments
            });

        uint indexLength = 3;

        uint[]    memory iddocs = new uint[](indexLength);
        bytes32[] memory names = new bytes32[](indexLength);
        bytes32[] memory hashes = new bytes32[](indexLength);

        for (uint i = 0; i < indexLength; i++) {
            Document storage document = allDocuments[i];
            iddocs[i] = document.idDoc;
            names[i] = document.name;
            hashes[i] = document.hash;
        }

        return (tempUser.id, tempUser.name, iddocs, names, hashes);
    }

    function login(uint _personId) public returns (uint, bytes32, uint[] memory, bytes32[] memory, bytes32[] memory){
        for (uint y = 0; y < users.length ; y++){
            if(users[y] == _personId){

                addDocuments();
                addDocuments();
                addDocuments();
                User memory tempUser  = User({
                    id: 756,
                    name: "Sergio",
                    userDocuments: allDocuments
                    });

                uint indexLength = 3;

                uint[]    memory iddocs = new uint[](indexLength);
                bytes32[] memory names = new bytes32[](indexLength);
                bytes32[] memory hashes = new bytes32[](indexLength);

                for (uint i = 0; i < indexLength; i++) {
                    Document storage document = allDocuments[i];
                    iddocs[i] = document.idDoc;
                    names[i] = document.name;
                    hashes[i] = document.hash;
                }

                return (tempUser.id, tempUser.name, iddocs, names, hashes);

            }
        }

        uint[]    memory iddocs;
        bytes32[] memory names;
        bytes32[] memory hashes;

        return (1, "0x111", iddocs, names, hashes);
    }

    string ipfsHash = 'prueba';

    function set(string memory x) public {
        ipfsHash = x;
    }

    function get() public view returns (string memory) {
        return ipfsHash;
    }


}
